import React, { useState, useEffect } from "react";
import axios from "axios";

function List(props) {
  const [Text, setText] = useState("");
  useEffect(() => {
    axios
      .post("/api/test")
      .then((response) => {
        alert("요청성공");
        console.log(response);
      })
      .catch((error) => {
        alert("요청실패");
        console.log(error);
      });
  }, []);
  return (
    <div>
      <h1>List</h1>
      <h3>{Text}</h3>
      {props.ContentList.map((content, idx) => {
        return (
          <div
            key={idx}
            style={{
              width: "100%",
              marginLeft: "1rem",
            }}
          >
            내용: {content}
            <hr />
          </div>
        );
      })}
    </div>
  );
}
export default List;
